import React from "react";
import Cardlist from "./cardlist";
import Searchbox from './Searchbox.js';
import {robots} from './robots';

const App = () => {
    return(
        <div className="tc">
            <h1>RoboFriends</h1>
            <Searchbox/>
            <Cardlist robots={robots}/>
        </div>
    );
}
export default App;
